## Tooltip

A tooltip is a graphical user interface element that is used to display a short piece of information, often as a hint or a quick reference, about an element in a graphical user interface.

## React Context

React Context is a way to essentially create global variables that can be passed around in a React app. This is the alternative to "prop drilling" or moving props from grandparent to child to parent, and so on. Context is designed to share data that can be considered “global” for a tree of React components.

## Tooltip Provider

The Tooltip Provider is a component that wraps the entire application and provides the context for the Tooltip component. It has a state that keeps track of the currently open Tooltip and a function to close it.

```jsx
import React, { createContext, useState } from 'react';

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [openTooltip, setOpenTooltip] = useState(null);

  const closeTooltip = () => {
    setOpenTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ openTooltip, setOpenTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```

## Tooltip Component

The Tooltip component is a child component that uses the context provided by the TooltipProvider. It has a reference to the tooltip element and a function to show the tooltip.

```jsx
import React, { useContext, useRef } from 'react';
import { TooltipContext } from './TooltipProvider';

export const Tooltip = ({ children, content, position = 'top' }) => {
  const { openTooltip, setOpenTooltip, closeTooltip } = useContext(TooltipContext);
  const tooltipRef = useRef(null);

  const showTooltip = () => {
    setOpenTooltip(tooltipRef);
  };

  const hideTooltip = () => {
    if (openTooltip === tooltipRef.current) {
      closeTooltip();
    }
  };

  return (
    <>
      <div onMouseEnter={showTooltip} onMouseLeave={hideTooltip}>
        {children}
      </div>
      {openTooltip === tooltipRef.current && (
        <div
          ref={tooltipRef}
          className={`tooltip ${position}`}
          onMouseEnter={showTooltip}
          onMouseLeave={hideTooltip}
        >
          {content}
        </div>
      )}
    </>
  );
};
```

## Usage

To use the Tooltip component, you need to wrap the entire application with the TooltipProvider component.

```jsx
import React from 'react';
import { TooltipProvider } from './TooltipProvider';
import Tooltip from './Tooltip';

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip content="Hello World!">
          <button>Hover me</button>
        </Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default App;
```

## Conclusion

In this article, we have learned how to create a Tooltip component in NextJS using React Context. The Tooltip component can be used in different places but doesn't have a scope context and is therefore isolated from itself. By using React Context, we can share data between components and close the previously opened Tooltip and so on.

